import { useDispatch } from "react-redux";
import { GET_PRODUCT_PROCESS } from "./redux-saga/admin/action/action";

function App() {

  const dispatch = useDispatch()
  const abc = dispatch({type:GET_PRODUCT_PROCESS})
  return (
    <>
    {
      abc.data?.map((val)=>{
        return(
          <>
          <h1>{val.title}</h1>
          </>
        )
      })
    }
    </>
  )
}

export default App;
